import * as React from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import IconButton from "@mui/material/IconButton";
import CloseIcon from "@mui/icons-material/Close";
import PropTypes from "prop-types";
import { makeStyles } from "@material-ui/core/styles";
const useStyless = makeStyles({
  root: {
    "& label.Mui-focused": {
      color: "#810CA8",
    },
    "& .MuiInput-underline:after": {
      borderBottomColor: "#810CA8",
    },
    "& .MuiOutlinedInput-root:hover .MuiOutlinedInput-notchedOutline": {
      borderColor: "#810CA8",
    },
  },
});
export default function Slice(props) {
  const classeusername = useStyless();
  const [openusername, setOpenusername] = React.useState(false);
  function BootstrapDialogTitle(props) {
    const { children, onClose, ...other } = props;

    return (
      <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
        {children}
        {onClose ? (
          <IconButton
            aria-label="close"
            onClick={onClose}
            sx={{
              position: "absolute",
              right: 8,
              top: 8,
              color: "#2D033B",
            }}
          >
            <CloseIcon />
          </IconButton>
        ) : null}
      </DialogTitle>
    );
  }
  const handleClickOpenusername = () => {
    setOpenusername(true);
  };

  const handleCloseusername = () => {
    setOpenusername(false);
  };
  BootstrapDialogTitle.propTypes = {
    children: PropTypes.node,
    onClose: PropTypes.func.isRequired,
  };
  return (
    <div>
      <Button variant="outlined" onClick={handleClickOpenusername}>
        Open form dialog
      </Button>

      <Dialog
        open={openusername}
        sx={{
          boxShadow: "0 8px 32px rgba(31,28,135,0.37)",
          backdropFilter: " blur(8.5px)",
        }}
      >
        <BootstrapDialogTitle
          id="customized-dialog-title"
          onClose={handleCloseusername}
          sx={{ color: "#2D033B" }}
        >
          username
        </BootstrapDialogTitle>
        <DialogContent>
          <DialogContentText>set a new username</DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="username"
            type="username"
            fullWidth
            variant="standard"
            className={classeusername.root}
          />
        </DialogContent>
        <DialogActions>
          <Button
            autoFocus
            onClick={handleCloseusername}
            sx={{ color: "#2D033B" }}
          >
            Save changes
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
